import React from 'react';
import { FaGithub,
  FaInstagramSquare,
  FaSnapchat,
  FaTwitter,
  FaYoutube,
  FaBell,
  FaHome,
  FaKaaba
} from "react-icons/fa";
import {
  GrGoogle,
  GrInstagram,
  GrSkype,
  GrWordpress


} from "react-icons/gr";
const SideBar = () => {
  return (
    <div className=' m-3'>
      <FaGithub className=' d-block m-1'/>
      <FaInstagramSquare className=' d-block m-1' />
    <  FaSnapchat className=' d-block m-1 '/>
   <   FaTwitter className=' d-block m-1'/>
      <FaYoutube className=' d-block m-1'/>
      <FaBell className=' d-block m-1' />
      <FaHome className=' d-block m-1'/>
      <FaKaaba className=' d-block m-1'/>
      <GrGoogle className=' d-block m-1' />
      <GrInstagram className=' d-block m-1'/>
      <GrSkype className=' d-block m-1'/>
      <GrWordpress className=' d-block m-1'/>

    </div>
  )
}

export default SideBar
